import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import '../css/OrderHistory.css';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

const OrderHistory = () => {
    const [data, setData] = useState([]);
    const [selectedOrder, setSelectedOrder] = useState(null);
    const { id } = useParams();

    useEffect(() => {
        axios.get(`http://localhost:4000/orderhistory/${id}`)
            .then(response => setData(response.data))
            .catch(error => console.error('Error fetching data:', error));
    }, [id]);

    return (
        <>
            <Navbar />
            <div className="header-container">
                <h2>Order History</h2>
            </div>
            <div className="container">
                {data.map(order => (
                    <div key={order.BookingId} className="card">
                        <h3>Booking ID: {order.BookingId}</h3>
                        <p>Booking Start Date: {order.BookingStartDate}</p>
                        <p>Booking End Date: {order.BookingEndDate}</p>
                        <p>NetAmount: {order.NetAmount}</p>
                        <p>Tax: {order.Tax}</p>
                        <p>Discount: {order.Discount}</p>
                        <h4>Total Price: ${order.TotalPrice}</h4>
                        <button className="details-button" onClick={() => setSelectedOrder(order)}>View Details</button>
                    </div>
                ))}
                {selectedOrder && (
                    <div className="details-panel">
                        <h2>Details for Booking ID: {selectedOrder.BookingId}</h2>
                        <ServiceDetails label="Service 1" order={selectedOrder} serviceNumber="SP1" serviceType="Laundry" />
                        <ServiceDetails label="Service 2" order={selectedOrder} serviceNumber="SP2" serviceType="House Cleaning" />
                        {selectedOrder.SP3UserId && <ServiceDetails label="Service 3" order={selectedOrder} serviceNumber="SP3" serviceType="PetCare" />}
                        <button className="close-button" onClick={() => setSelectedOrder(null)}>Close</button>
                    </div>
                )}
                <Footer />
            </div>
        </>
    );
}

const ServiceDetails = ({ label, order, serviceNumber, serviceType }) => (
    <>
        <p>{label}: <br />
            <span>Name: {order[`${serviceNumber}FirstName`]} {order[`${serviceNumber}LastName`]}</span><br />
            <span>Service Type: {serviceType}</span><br />
            <span>Address: {order[`${serviceNumber}Address1`]}, {order[`${serviceNumber}Address2`]}, {order[`${serviceNumber}City`]}, New Jersey, {order[`${serviceNumber}Country`]} - {order[`${serviceNumber}ZipCode`]}</span><br />
            <span>Email Address: {order[`${serviceNumber}EmailId`]}</span><br />
            <span>Contact No: {order[`${serviceNumber}ContactNo`]}</span><br />
        </p><br />
    </>
);

export default OrderHistory;
